function ShelterItem({ shelter: {id, name, city, avatar, contact, phone, email}}) {
    return(
        <div className="shelter-card d-flex flex-column align-items-center">
            <img width="50px" className="shelter-img" src="https://res.cloudinary.com/getapet/image/upload/v1617970328/default_avatar_xnnmwl.png" alt="default" />
            <h5>{name}</h5>
        </div>
    );
}

export default ShelterItem;
